import { Route, Router, Switch } from "react-router-dom";
import AllQuotes from "./components/pages/AllQuotes";

function App() {
  return (
    <div>
      <main>
        <Switch>
          <Router>
            <Route path="/quotes">
              <AllQuotes />
            </Route>
            <Route path="/quotes/:quoteId">

            </Route>
            <Route path="/new-quote"></Route>
          </Router>
        </Switch>
      </main>
    </div>
  );
}

export default App;
